import image from './hat.jpg'

const INITIAL_STATE = {
  womenOptions: [
    {
      title: 'hats',
      imageUrl: image,
      id: 1,
      linkUrl: 'shop/womens/hats'

    },
    {
      title: 'jackets',
      imageUrl: 'https://img.ltwebstatic.com/images3_pi/2019/10/12/1570867452b0bb0c99a563daff99af1933ea94dff7_thumbnail_600x.webp',
      id: 2,
      linkUrl: 'shop/jackets'
    },
    {
      title: 'sneakers',
      imageUrl: 'https://i.ibb.co/0jqHpnp/sneakers.png',
      id: 3,
      linkUrl: 'shop/sneakers'
    },
  ]
}

const genderOptionReducer = (state=INITIAL_STATE, action) => {
  switch(action.type) {
    default:
      return state
  }
}

export default genderOptionReducer
